import React from "react";
import { Container } from "react-bootstrap";
import HeaderNavigation from "./HeaderNavigation";
import HeroSection from "./HeroSection";
import InfoSection from "./InfoSection";
import HowItWorks from "./HowItWorks";

const Layout = () => {
  return (
    <Container
      fluid
      className="d-flex flex-column min-vh-100"
      style={{
        background: "#2C2C2C", // Dark sleek background
        backgroundImage: "url('https://www.transparenttextures.com/patterns/real-carbon-fibre.png')", // High-tech texture
        backgroundAttachment: "fixed",
        color: "#ffffff"
      }}
    >
      <HeaderNavigation />
      {/* Section one start*/}
      <div
        style={{
          background: "#1E1E1E",
          padding: "50px 20px",
          borderRadius: "16px",
          margin: "30px auto",
          marginTop: "100px",
          maxWidth: "1200px",
          boxShadow: "0px 6px 18px rgba(0, 0, 0, 0.3)",
          color: "#e0e0e0"
        }}
      >
        <HeroSection />
        <InfoSection />
      </div>
      {/* Section one end*/}
      {/* Section two start */}
      <div
        style={{
          background: "#1E1E1E",
          padding: "50px 20px",
          borderRadius: "16px",
          margin: "30px auto",
          maxWidth: "1200px",
          boxShadow: "0px 6px 18px rgba(0, 0, 0, 0.3)",
          color: "#e0e0e0"
        }}
      >
        <HowItWorks />
      </div>
      {/* Section two end */}
    </Container>
  );
};

export default Layout;
